import React from 'react';
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

function ParticleBg() {
    async function loadParticles(main) {
        await loadFull(main);
        // Puedes realizar alguna inicialización adicional aquí si es necesario para la carga de las partículas
    }

    return (
        <Particles
            id='tsparticles'
            init={loadParticles}
            options={{
                "fullScreen": {
                    "enable": true,
                    "zIndex": 1
                },
                "particles": {
                    // Configuración de las partículas
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": ["grab"]
                        },
                        "onclick": {
                            "enable": false,
                            "mode": ["bubble"] // Corrección aquí, mode debe ser un array
                        },
                        "resize": true
                    },
                    "modes": {
                        // Configuración de modos de interactividad
                    }
                },
                "retina_detect": true,
                "background": {
                    // Configuración del fondo
                }
            }}
        />
    );
}

export default ParticleBg;
